- input: "TEXT\x1CC00459065\x1CSA11AI.4422.TEXT\x1CSA11AI.4422\x1CSA11AI\x1CThe Treasurer
    of the Stinson Morrison Hecker Political Action Committee (PAC), Phillip Fraas,
    has provided exempt legal and accounting services during the first half of 2009,
    and the PAC is hereby reporting the receipt of these services, as provided for
    in 11 C.F.R. 104.3(h).  Following are the dates those services were provided,
    and the time spent in providing the services.  Mr. Fraas's employer, Stinson Morrison
    Hecker, pays MR. Fraas primarily based on his receipt of payments from clients
    for his provision of legal services to them.  Since the services being reported
    here are provided 'gratis' to the PAC, and since the firm is not paying him directly
    for providing those services, the value of his exempt legal and accounting services
    for the purposes of the report can't be determined by billings or collection on
    the hours worked in providing those services.  However, Mr. Fraas recorded 1,121
    hours of work in the first half of 2009for which he was paid $765,000 by the firm.
    \ And, as itemized below, he spent 48.5 of those hours providing the exempt legal
    and accounting services.  The percentage of total hours spent on the exempt services
    comes to approximately 4.3%, and 4.3% of $75,000 is $3,225.  Thus, Mr. Fraas values
    his exempt services during the first half of the year at $3,225.  ...Continued
    on Report Memo.\n"
